år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Flogseq____&quot;,978,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Xlogseq____&quot;,294,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Vlogseq____&quot;,294,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Ulogseq____&quot;,294,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Ulogseq____&quot;,295,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Ulogseq____&quot;,436,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Jlogseq____&quot;,[],536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Hlogseq____&quot;,295,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^Hlogseq____&quot;,436,536870972]],[logseq____&quot;^15logseq____&quot;,[985,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u666b2ce5-35ae-4eee-96e7-2389afcf805blogseq____&quot;,536870972]],[logseq____&quot;^15logseq____&quot;,[986,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Bedstefar var en højtrangerende præst inden \\logseq____&quot;Skandalen\\logseq____&quot;logseq____       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
